import { ProductActionsType } from '../actions/products.action';
import { initialProductsState } from '../state/app.state';
export function productsReducer(state = initialProductsState, action) {
  switch (action.type) {
    case ProductActionsType.GET_PRODUCTS:
      {
        return Object.assign(Object.assign({}, state), {
          products: action.products
        });
      }

    default:
      return state;
  }
}
